import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import Navbar from '../Navbar';
import ScrollToTop from './ScrollToTop'




function Home() {

  return (
    <>
      <Navbar />
      <HeroSection />
      <Cards />
      <Footer />
     
    </>
  );
}

export default Home;
